static
void init_array(double *X, double *A, double *B, int N)
{
    int i, j;

    for (i=0; i<N; i++) {
        for (j=0; j<N; j++) {
            A[(i)*N + j] = (1+(i*j)%1024)/2.0;
            B[(i)*N + j] = (1+(i*j)%1024)/3.0;
            X[(i)*N + j] = (1+(i*j)%1024)/3.0;
        }
    }
}

